import React, { useEffect, useState } from "react";
import {Route, Switch} from "react-router-dom";
import App from "./App";
import CreateNote from "./CreateNote";
import Note from "./Note";
import Error from "./Error";



const Routerpage = () =>{
    const [num, setNum] = useState(1);
    const [nums, setNums] = useState(2);

    useEffect(()=>{
        alert(`Clicked ${num}`);
    },[]);
    return(
        <>
        <Switch>
            <Route exact path="/" component={App}/>
            <Route path="/1" component={CreateNote}/>
            <Route path="/2" component={Note}/>
            <Route component={Error}/>
        </Switch>

        <div className="box_center">
        <button className="button" onClick={()=>{ setNum(num+1);}}>Click Me {num}</button>
        

        <button className="button" onClick={()=>{ setNums(nums+1);}}>Click Me {nums}</button>
        </div>
        </>
    );
}
export default Routerpage;
